import { React, Component } from 'react';

class Card extends Component {
    text = this.props.text || 'text';
    key = this.props.shift_key || 'key';
    render() {
        return (
            <div>
                <p>Text: {this.text}</p>
                <p>Key: {this.key}</p>
            </div>
        );
    }
}

export default Card;
